import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function App() {
    return <div>
        <Header></Header>
        {notes.map()}
        <Note title="Nota 1" content="Contenido 1"></Note>
        <Note title="Nota 2" content="Contenido 2"></Note>
        <Note title="Nota 3" content="Contenido 3"></Note>
        <Note title="Nota 4" content="Contenido 4"></Note>
        <Footer></Footer>
    </div>
}

export default App;

/* <Header></Header>
            <Note></Note>
            <Footer></Footer> */
